# build the classifer based on training data
def get_data():
    imagesn = []
    imagesp = []
    for f in ["nutritious.txt", "poisnous.txt"]:
        # ct = 0
        infile = open(f, 'r')
        image = []
        ct = 0
        while ct < 1000:
            line = infile.readline().strip()
            if not line:
                # image.append([])
                line = infile.readline().strip()
            if line.find('END') == 0:
                break
            # if image:
            #     images.append(image)
            #     ct += 1
            if f.find('nutritious') == 0:
                image = imagesn
            else:
                image = imagesp
            temp = [int(r) for r in line.strip().split(', ')]
            # for i in range(6):
            #     image.append(temp[i*6:i*6+6])
            image.append(temp)
            ct += 1
        # if image:
        #     images.append(image)
        features = imagesn+imagesp
        labels = [1 for i in range(len(imagesn))] + [0 for j in range(len(imagesp))]

    # print len(features), len(labels)
    # print labels.count(0), labels.count(1)
    return (features, labels)


def avg_data():
    numavg = 5
    (features, labels) = get_data()
    features_res = [[0. for i in range(len(features[0]))] for j in range(len(features)/numavg)]
    labels_res = labels[0::numavg]
    for feat in range(len(features)):
        for f in range(len(features[feat])):
            # print features[feat][f] / numavg
            features_res[feat / numavg][f] += features[feat][f] / float(numavg)
    # print len(features), len(labels), len(features_res), len(labels_res)
    return (features_res, labels_res)


def build_model(mode):
    global model
    (features, labels) = avg_data()
    if mode == "default":
        learner = milk.defaultclassifier()
    elif mode == "tree":
        learner = milk.supervised.tree.tree_learner()
    elif mode == "svm":
        learner = milk.supervised.svm.svm_raw(kernel=np.dot, C=12)
    model = learner.train(features, labels)


