def build_svm():
    global svc

    (features, labels) = avg_data()
    # svc = svm.SVC(kernel='linear')
    # svc = svm.SVC(kernel='poly', degree=3)
    return svc.fit(features, labels)


def test_svm():
    global svc
    (features, labels) = avg_data()
    return cross_validation.cross_val_score(svc, features, labels, cv=5)


